import React, { FunctionComponent, useEffect, useState } from 'react';
import TextField from '@material-ui/core/TextField';
import CSS from 'csstype';
import Fab from '@material-ui/core/Fab';
import SearchIcon from '@material-ui/icons/Search';
import type {SearchObj} from '../types'


export const Search: FunctionComponent<{setSearchedObj: Function,startSearch: Function  }> = ({setSearchedObj, startSearch})=> {
  const [title, setTitle] = useState("");
  const [n, setN] = useState("");

  function search(){
    setSearchedObj({title:title,n:n})
    startSearch(title,n)
  }

  return <>
  <div style={containerStyle}>
    <div style={formStyle} >
    <TextField
      id="standard-full-width"
      label="Title"
      style={{ margin: 8 }}
      fullWidth
      margin="normal"
      InputLabelProps={{
        shrink: true,
      }}
      onChange={element =>setTitle(element.target.value)}

    />
    <div style={numberStyle}>

    <TextField
      id="outlined-number"
      label="Number"
      type="number"
      InputLabelProps={{
        shrink: true,
      }}
      variant="outlined"
      onChange={element =>setN(element.target.value)}

    />
    </div>
    <div style={buttonStyle}>
      <Fab aria-label="search" onClick={search }>
        <SearchIcon />
      </Fab>
    </div>
    </div>
  </div>
  </>
}



const containerStyle: CSS.Properties = {

};

const buttonStyle: CSS.Properties = {
  float: 'right'
};
const numberStyle: CSS.Properties = {
  float: 'left'
};
const formStyle: CSS.Properties = {
  backgroundColor: 'bisque',
  alignSelf: 'flex-start',
  alignContent: 'stretch',
  marginTop: '50px'
};
